import request from '@/utils/request'; //评价模型树查询

export function queryRecordTree(query) {
  return request({
    url: "/SRMsupplier/supplierEvaluationModel",
    method: 'get',
    params: query
  });
} //评价模型（新增）

export function addRecord(data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationModel",
    method: 'post',
    data: data
  });
} //评价模型（编辑）

export function updateRecord(rowId, data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationModel/".concat(rowId),
    method: 'patch',
    data: data
  });
} //评价模型删除

export function deleteRecord(rowId) {
  return request({
    url: "/SRMsupplier/supplierEvaluationModel/".concat(rowId),
    method: 'delete'
  });
} //评价模型（权重配置）

export function setWeight(data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationModel/weight",
    method: 'patch',
    data: data
  });
} //评价模型预览

export function queryRecord(query) {
  return request({
    url: "/SRMsupplier/supplierEvaluationModel/view",
    method: 'get',
    params: query
  });
